import { Container } from "./styles";

const Header = () => {
  return (
    <Container>
      <div className="headerBox">
        <h1>Kenzie Shop</h1>
        <div className="menu">
          <button>Cart</button>
          <button>Login</button>
        </div>
      </div>
    </Container>
  );
};

export { Header };
